//saga
export function addReserveRequest(id) {
  return {
    type: 'ADD_RESERVE',
    id,
  };
}
//reducer
export function addReserveSuccess(id) {
  return {
    type: 'ADD_RESERVE',
    id,
  };
}
export function removeReserve(id) {
  return {
    type: 'REMOVE_RESERVE',
    id,
  };
}

export function updateAmountReserve(id, amount) {
  return {
    type: 'UPDATE_RESERVE',
    id,
    amount,
  };
}
